('559f0844-ef9b-4ed7-bf0d-71fb8465b092','Mengikuti keputusan rapat tidak lebih baik daripada mengikuti pendapat pribadi.','559f0844-ef9b-4ed7-bf0d-71fb8465bQ01', 'Admin', NOW()),
