('559f0844-ef9b-4ed7-bf0d-71fb8465b095','Menyalahkan diri sendiri karena hasil yang mengecewakan lebih baik daripada mencari penyebab kesalahan.','559f0844-ef9b-4ed7-bf0d-71fb8465bQ01', 'Admin', NOW()),
