('559f0844-ef9b-4ed7-bf0d-71fb8465b098','Saya mendahulukan memberikan sumbangan untuk korban banjir dekat rumah daripada berkumpul dengan teman di restoran mahal.','559f0844-ef9b-4ed7-bf0d-71fb8465bQ01', 'Admin', NOW()),
('559f0844-ef9b-4ed7-bf0d-71fb8465b099','Ketika terjadi kegagalan, saya akan mencari tahu sebab kegagalan daripada mengutuk diri sendiri.','559f0844-ef9b-4ed7-bf0d-71fb8465bQ01', 'Admin', NOW()),
