CREATE EXTENSION IF NOT EXISTS "uuid-ossp";

drop table public.users;
drop table public.user_role;

CREATE TABLE public.user_role (
	id VARCHAR(50) primary key not NULL,
	role_name varchar(30) NOT NULL,
	role_code varchar(30) NOT NULL,
	created_by varchar(36) NOT NULL,
	created_at timestamp NOT NULL,
	updated_by varchar(36) NULL,
	updated_at timestamp NULL,
	"version" int4 default 0,
	is_active bool default true,
	CONSTRAINT role_bk UNIQUE (role_code)
);

CREATE TABLE public.users (
	id varchar(50) PRIMARY KEY not NULL,
	username varchar(50) NOT NULL,
	"password" varchar(225) NOT NULL,
	role_id varchar(36) NOT NULL,
	image varchar(225) NULL,
	created_by varchar(36) NOT NULL,
	created_at timestamp NOT NULL,
	updated_by varchar(36) NULL,
	updated_at timestamp NULL,
	"version" int4 default 0,
	is_active bool default true,
	CONSTRAINT user_bk UNIQUE (username)
);

CREATE TABLE public.question_type (
	id varchar(50) PRIMARY KEY not NULL,
	type_code varchar(50) NOT NULL,
	type_name varchar(225) NOT NULL,
	created_by varchar(36) NOT NULL,
	created_at timestamp NOT NULL,
	updated_by varchar(36) NULL,
	updated_at timestamp NULL,
	"version" int4 default 0,
	is_active bool default true,
	CONSTRAINT question_type_bk UNIQUE (type_code)
);

CREATE TABLE public.question (
	id varchar(50) PRIMARY KEY not NULL,
	question text NOT NULL,
	question_type_id varchar(36) not null,
	created_by varchar(36) NOT NULL,
	created_at timestamp NOT NULL,
	updated_by varchar(36) NULL,
	updated_at timestamp NULL,
	"version" int4 default 0,
	is_active bool default true,
	CONSTRAINT question_type_fk foreign KEY (question_type_id) references question_type(id)
);

CREATE TABLE public.answer (
	id varchar(50) PRIMARY KEY not NULL,
	answer varchar(50) NOT NULL,
	value varchar(36),
	question_id varchar(36) not null,
	created_by varchar(36) NOT NULL,
	created_at timestamp NOT NULL,
	updated_by varchar(36) NULL,
	updated_at timestamp NULL,
	"version" int4 default 0,
	is_active bool default true,
	CONSTRAINT question_fk foreign KEY (question_id) references question(id)
);

	
	


